#coding=utf-8

'''
You are given a m x n 2D grid initialized with these three possible values.

1.-1  - A wall or an obstacle.
2.0  - A gate.
3.INF  - Infinity means an empty room.
We use the value 2^31 - 1 = 2147483647 to represent INF as you may assume that the distance to a gate is less than 2147483647.

Fill each empty room with the distance to its nearest gate.
If it is impossible to reach a gate, it should be filled with INF.

Example:

Given the 2D grid:

INF  -1  0  INF
INF INF INF  -1
INF  -1 INF  -1
  0  -1 INF INF

After running your function, the 2D grid should be:
  3  -1   0   1
  2   2   1  -1
  1  -1   2  -1
  0  -1   3   4
'''

#1.通过INF寻找gate(0)，无论采用DFS还是BFS，都会TLE，最坏的情况O(m²n²),每个元素都要遍历m*n次
#2.从gate(0)扩张出去寻找INF，采用BFS会非常高效,O(m*n);为了代码整洁，对每个元素朝四个邻域的遍历，
#   可以将方向定义成一个二维数组directions: [[x-1,y],[x+1,y],[x,y-1],[x,y+1]]，遍历directions
#   4次遍历的处理方式都一样


import collections

def wallsAndGates_TLE(rooms):
    roomV = 2 ** 31 - 1
    M, N = len(rooms), len(rooms[0])

    def distance(i,j):
        connect = collections.deque()
        connect.append((i,j,0,[(i,j)]))
        visitor = set()
        while connect:
            i, j, d, path = connect.popleft()
            if (i,j) in visitor: continue

            visitor.add((i,j))
            if rooms[i][j] == 0:
                for i,node in enumerate(path):
                    #print(path)
                    if rooms[node[0]][node[1]] == roomV:
                        rooms[node[0]][node[1]] = d-i
                    else:
                        break
                return

            if i+1<M and rooms[i+1][j] != -1:
                connect.append((i+1, j, d+1, path+[(i+1,j)]))
            if i-1>=0 and rooms[i-1][j] != -1:
                connect.append((i-1, j, d+1, path+[(i-1,j)]))
            if j+1<N and rooms[i][j+1] != -1:
                connect.append((i, j+1, d+1, path+[(i,j+1)]))
            if j-1>=0 and rooms[i][j-1] != -1:
                connect.append((i,j-1, d+1, path+[(i,j-1)]))

        return

    for i in range(M):
        for j in range(N):
            if rooms[i][j] == roomV:
                distance(i,j)


def wallsAndGates(rooms):
    EMPTY = 2**31-1
    directions = [[-1,0],[1,0],[0,-1],[0,1]]
    m,n = len(rooms), len(rooms[0])

    q = collections.deque()
    for i in range(m):
        for j in range(n):
            if rooms[i][j] == 0:
                q.append((i,j))

    while q:
        x,y = q.popleft()
        for dir in directions:
            ln,cl = x+dir[0], y+dir[1]
            if ln<0 or ln>=m or cl<0 or cl>=n or rooms[ln][cl] != EMPTY:
                continue
            rooms[ln][cl] = rooms[x][y]+1
            q.append((ln,cl))



